        data: Define the overall look and feel of an application by defining areas of the UI that ground the user around which application they are working in.
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
