      - type: 0x00dd
        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: "Display documents in context, rather than opening multiple tabs."
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
      - type: 0x0083
        PABID: 3
      - type: 0x00dd
        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: "They can even be used to define how an application should look across multiple form factors such as desktop, tablet, and phone. Desktop layouts are viewable in Notes and Nomad web, while tablet and phone screen sizes would be the default on Nomad Mobile."
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
      - type: 0x0083
        PABID: 2
      - type: 0x00dd
