        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: It is best to define a frameset as the launch property for the application. This way the structure of the frameset defines what the layout of an application looks like when it is open and provides the Designer with more control.
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
