        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: "The standard Domino Application commonly has the following framesets:"
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
