      - type: 0x00dd
        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: "Application name: Which helps ground the user around which application they have opened. Also, uses color to help with wayfinding and branding of the application. Companies could choose to have the same color across all applications or use different colors still within their brand language to help define different types of application. Similar, to what is provided in the out of box templates."
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
      - type: 0x0083
        PABID: 3
      - type: 0x00dd
        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: "Outline: Outlines should be created using a page and an embedded outline design element. This way there are more styling options to the designer. It also, provides more control over the user experience in how the user consumes the different types of data in the application. The outline provides the ability to order and group items in a logically based on the task that the application is used for."
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
      - type: 0x0083
        PABID: 3
      - type: 0x00dd
        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: "Server location: The name of the server that the application is located, is helpful so that the user can insure they are working with the correct replica or copy."
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
      - type: 0x0083
        PABID: 3
      - type: 0x00dd
        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xcdf0005
        data: "Main Content: Any of the following could be used to display in the main content section: Page, Form, or View. Views are the most common, but it is up to the designer for what would make for the best user experience. Then when you would like to have other types of content to display in context, you can define within the outline properties to display that element within the main content frame."
